import { Button } from "react-scroll/modules";
import "./App.css";

function App() {
  return (
    <div className="Homepage">
      <div className="homepage-menu">
      <img src={require('/Users/Admin/Unstable Unicorns/client/src/assets/logoUU.png')} alt="LOGO" width='400px' class='center'  />
        <div className="homepage-form">
          <div className="homepage-join"> <Button theme="pink" >
          Pink theme
        </Button></div>

          <div className="homepage-create"> </div>
        </div>
      </div>
    </div>
  );
}

export default App;
